import "./ExpenseItem.css";

function ExpenseItem(expenseItemList) {
  const month = expenseItemList.date.toLocaleString("en-US", { month: "long" });
  const day = expenseItemList.date.toLocaleString("en-US", { day: "2-digit" });
  const year = expenseItemList.date.getFullYear();

  return (
    <div className="expense-item">
      <div>
        <div>{month}</div>
        <div>{day}</div>
        <div>{year}</div>
      </div>
      <div>
        <h2> {expenseItemList.name}</h2>
      </div>
      <div className="expense-item__description">
        <h2> {expenseItemList.date.toISOString()}</h2>
        <h2> {expenseItemList.locationOfExpenditure}</h2>
        <div className="expense-item__price">${expenseItemList.amount}</div>
      </div>
    </div>
  );
}

export default ExpenseItem;
